import React from 'react';

class Order extends React.Component {
  render() {
    return(
      <div className="order">
        <div className="order-status">
          <p>Pending</p>
        </div>

        <div className="order-code">
          <p>ABC123</p>
        </div>

        <div className="order-name">
          <p>Jorge Chirinos</p>
        </div>

        <div className="order-app">
          <p>Uber Eats</p>
        </div>
      </div>
    )
  }
}

export default Order;
